import React from "react";
import Badge from "../Badge/Badge";
import "./Project.scss";
import "../Button/Button.scss";

export default function Project({ data }) {
  return (
    <article className="project">
      <img
        className="project__img"
        alt={"Screenshot of " + data.title}
        src={"http://localhost:1337" + data.image.data.attributes.url}
      />
      <h3 className="project__title">{data.title}</h3>
      <p className="project__description">{data.description}</p>
      <div className="project__badges">
        {data.badges.data.map((badge, i) => (
          <Badge key={i}>{badge.attributes.badge}</Badge>
        ))}
      </div>
      <a className="project__github">
        <svg
          height="24"
          viewBox="0 0 24 24"
          width="24"
          xmlns="http://www.w3.org/2000/svg"
        >
          <path
            d="M9 19c-5 1.5-5-2.5-7-3m14 6v-3.87a3.37 3.37 0 0 0-.94-2.61c3.14-.35 6.44-1.54 6.44-7A5.44 5.44 0 0 0 20 4.77 5.07 5.07 0 0 0 19.91 1S18.73.65 16 2.48a13.38 13.38 0 0 0-7 0C6.27.65 5.09 1 5.09 1A5.07 5.07 0 0 0 5 4.77a5.44 5.44 0 0 0-1.5 3.78c0 5.42 3.3 6.61 6.44 7A3.37 3.37 0 0 0 9 18.13V22"
            fill="none"
            stroke="#000"
            stroke-linecap="round"
            stroke-linejoin="round"
            stroke-width="2"
          />
        </svg>
      </a>
    </article>
  );
}
